package org.santihs.examples.set;import java.util.Comparator;import java.util.Set;import java.util.TreeSet;public class TreeSetExample {    public static void main(String[] args) {        Set<String> ts = new TreeSet<>((a, b) -> a.compareTo(b));        ts.add("uno");        ts.add("dos");        ts.add("tres");        ts.add("tres");        ts.add("cuatro");        ts.add("cinco");        System.out.println("ts = " + ts);        Set<Integer> numbers = new TreeSet<>(Comparator.reverseOrder());        numbers.add(1);        numbers.add(5);        numbers.add(4);        numbers.add(10);        numbers.add(3);        numbers.add(2);        System.out.println("numbers = " + numbers);    }}